import React from "react";
import HeaderStart from "./components/HeaderStart";
import Menu from "./components/Menu";
import Consult from "./views/Consult";
import WeDo from "./views/WeDo";



const Layout = () =>{
    return(
        <>
            <HeaderStart />
            <Menu/>
            <Consult/>
            <WeDo/>
        </>
    )
    
}

export default Layout;
